import React from 'react';

const Map = () => {

    function initMap(){
        var options = {
            zoom: 8,
            center:{lat: 48.852024, lng: 2.28666},
            src:"https://maps.googleapis.com/maps/api/js?key=AIzaSyCIc-9Qw-Ime5dg4ADN5kCpgY-hbPkBwKQ&callback=initMap&v=weekly"
        }
        var map = new google.maps.Map(document.getElementById('map'),options);
    }

    return(
        <div className="map">
            <h1>Google Map</h1>
            
            </div>
    )
}

export default Map;

